import * as React from "react";
import {
  Box,
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  TextField,
  Typography,
  Button,
  Stack,
  Grid,
} from "@mui/material";
import { useState, useEffect } from "react";
import Dropzone from "react-dropzone";
import { Theme } from "../others/Theme";
import folder from "../others/folder.png";
import createServece from "../services/items";
import { InputData } from "../components/InputData";

export const CreateProduct = () => {
  const [items, setItems] = useState();
  const [nft, setNft] = useState({
    name: "",
    file: "",
    description: "",
    tag: "",
    externalLink: "",
    quantity: "",
    blockchain: "",
  });

  console.log({ nft });
  useEffect(() => {
    createServece.getAll().then((initialItems) => {
      setItems(initialItems);
    });
  }, []);

  const addItem = (event) => {
    event.preventDefault();

    createServece.create(nft).then((returnedItem) => {
      setItems(items.concat(returnedItem));
    });

    setNft({
      name: "",
      file: "",
      description: "",
      tag: "",
      externalLink: "",
      quantity: "",
      blockchain: "",
    });
  };
  console.log(nft);
  return (
    <>
      <Dropzone onDrop={(file) => setNft({ ...nft, file })}>
        {({ getRootProps, getInputProps }) => (
          <Box
            sx={{
              bgcolor: Theme.palette.otherColor.main,
              boxShadow: 1,
              borderRadius: 5,
              p: 2,
              m: 1,
              mt: 3,
              ml: 2,
              mr: 2,
              mb: 2,
              pb: 8,
            }}
            {...getRootProps()}
          >
            <section style={{ height: "10rem" }}>
              <div>
                <input {...getInputProps()} />
                <Typography align="center">
                  <img src={folder} height={50} width={50} />
                </Typography>
                <Typography align="center">
                  Drag 'n' drop some files here, or click to select files
                </Typography>
              </div>
            </section>
          </Box>
        )}
      </Dropzone>
      <Box sx={{ width: "100%", ml: 2 }}>
        <Stack direction="row" spacing={2}>
          <Grid container spacing={3} sx={{ maxWidth: "50%" }}>
            <InputData
              value={nft.name}
              onChange={(e) => setNft({ ...nft, name: e.target.value })}
              label={"Name"}
            />

            <Grid xs>
              <Box
                sx={{
                  bgcolor: Theme.palette.secondary.light,
                  boxShadow: 1,
                  borderRadius: 5,
                  p: 2,
                  m: 3,
                  "&:hover": {
                    backgroundColor: Theme.palette.secondary.main,
                  },
                }}
              >
                <TextField
                  label="External Link"
                  value={nft.externalLink}
                  onChange={(e) =>
                    setNft({ ...nft, externalLink: e.target.value })
                  }
                />
              </Box>
            </Grid>
            <Grid>
              <Box
                sx={{
                  bgcolor: Theme.palette.secondary.light,
                  boxShadow: 1,
                  borderRadius: 5,
                  p: 2,
                  m: 3,
                  "&:hover": {
                    backgroundColor: Theme.palette.secondary.main,
                  },
                }}
              >
                <TextField
                  label="Quantity"
                  value={nft.quantity}
                  type="number"
                  onChange={(e) => setNft({ ...nft, quantity: e.target.value })}
                />
              </Box>
            </Grid>
          </Grid>

          <Grid container spacing={3} sx={{ maxWidth: "50%" }}>
            <Grid xs={14} md={9}>
              <Box
                sx={{
                  bgcolor: Theme.palette.secondary.light,
                  boxShadow: 1,
                  borderRadius: 5,
                  p: 2,
                  maxWidth: "max",
                  "&:hover": {
                    backgroundColor: Theme.palette.secondary.main,
                  },
                }}
              >
                <Typography>select blockchain</Typography>
                <FormControl sx={{ m: 1, minWidth: 120 }}>
                  <InputLabel>blockchain</InputLabel>
                  <Select
                    value={nft.blockchain}
                    onChange={(e) =>
                      setNft({ ...nft, blockchain: e.target.value })
                    }
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    <MenuItem value={1}>blockchain1</MenuItem>
                    <MenuItem value={2}>blockchain2</MenuItem>
                    <MenuItem value={3}>blockchain3</MenuItem>
                  </Select>
                </FormControl>
              </Box>
            </Grid>
            <Grid xs={14} md={9}>
              <Box
                sx={{
                  bgcolor: Theme.palette.secondary.light,
                  boxShadow: 1,
                  borderRadius: 5,
                  p: 2,
                  "&:hover": {
                    backgroundColor: Theme.palette.secondary.main,
                  },
                }}
              >
                <Typography>select tag</Typography>
                <FormControl sx={{ m: 1, minWidth: 120 }}>
                  <InputLabel>Tag</InputLabel>
                  <Select
                    value={nft.tag}
                    label="Tag"
                    onChange={(e) => setNft({ ...nft, tag: e.target.value })}
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    <MenuItem value={1}>Art</MenuItem>
                    <MenuItem value={2}>Music</MenuItem>
                    <MenuItem value={3}>Photo</MenuItem>
                  </Select>
                </FormControl>
              </Box>
            </Grid>
          </Grid>
        </Stack>
      </Box>
      <Box
        sx={{
          bgcolor: Theme.palette.secondary.light,
          boxShadow: 1,
          borderRadius: 5,
          p: 3,
          m: 3,
          "&:hover": {
            backgroundColor: Theme.palette.secondary.main,
          },
        }}
      >
        <TextField
          label="Description"
          fullWidth
          value={nft.description}
          onChange={(e) => setNft({ ...nft, description: e.target.value })}
        />
      </Box>
      <Box>
        <Button
          sx={{
            backgroundColor: Theme.palette.primary.light,
            color: "#888",
            "&:hover": {
              backgroundColor: Theme.palette.primary.main,
            },
          }}
          variant="contained"
          onClick={(event) => addItem(event)}
        >
          create
        </Button>
      </Box>
    </>
  );
};
